import React from "react"
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import Login from "../../pages/shared/login";
import Register from "../../pages/shared/register";
import Home from "../../pages/home";
import AppRoutes from "../../utils/app-routes";

const Stack = createNativeStackNavigator();

const AuhtRoutes = AppRoutes.Auth.childs;
const AuthMasterStack = ({ initialRoute = AppRoutes.Auth.initialRoute }) => {
    return (
        <Stack.Navigator  screenOptions={{ headerShown: false }} initialRouteName={initialRoute}>
            <Stack.Screen name={AuhtRoutes.Login.name} component={Login} />
            <Stack.Screen name={AuhtRoutes.Register.name} component={Register} />
            <Stack.Screen name={AuhtRoutes.Home.name} component={Home} />
        </Stack.Navigator>
    );
}

export default AuthMasterStack;
